import { TimeoutLogic } from "./Utils/TimeoutLogic";

function Dashboard(props) {
  const [data, setData] = useState("");
  const navigate = useNavigate();

  const userdata = {
    student_admissions_id: 1013,
  };
  const loadUserData = async () => {
    await axios

      .post(
        "https://5148-103-141-51-42.in.ngrok.io/api/v1/studentProfile",
        userdata,

        {
          headers: {
            Authorization: `Bearer ${"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJyZXN1bHQiOnsiaWQiOjEsIm5hbWUiOiJBZG1pbiIsImVtYWlsIjoiYWRtaW5AZ21haWwuY29tIiwiZW1haWxfdmVyaWZpZWRfYXQiOm51bGwsInJlbWVtYmVyX3Rva2VuIjpudWxsLCJjcmVhdGVkX2F0IjpudWxsLCJ1cGRhdGVkX2F0IjpudWxsLCJyb2xlIjoiYWRtaW4iLCJwYXNzd29yZF9kaWdlc3QiOm51bGx9LCJpYXQiOjE2Njc5ODM3ODAsImV4cCI6MTY2Nzk5MDk4MH0.U6tWTGT5i56-huMyDbU6bcZcDM6yGfgWrMVdMfJSm7o"}`,

            "Content-Type": "application/json",
          },
        }
      )
      .then((response) => {
        setValue(response.data.data[0]);

        console.log("value", response.data.data[0].DOB);
      });
  };

  useEffect(()=>{
    loadUserData()
  },)

  const handleLogout = () => {
    removeUserSession();
    navigate("/");
  };

  return (
    <div className="container log bg-dark text-white">
      <h1>{data.DOB}</h1>
